import React from "react";
import Total from "../../components/Total";
import { PlusButton, MinusButton } from "../AddQtyBtn";

function CartContents() {
    return (
        <div>
            <h1>Your Cart</h1>
            <div>
                Cart Contents will go here
                <PlusButton/>
                <MinusButton/>
            </div>
            <div>
                CART TOTAL: <Total />
            </div>

        </div>
    )
};

export default CartContents;
